import {Component, OnInit} from '@angular/core';
import {ActivatedRoute} from "@angular/router";
import {PlayerProfilesService} from "./player-profiles.service";
import {PlayerProfileRm} from "./player-profile.rm";
import {FormBuilder, FormControl, FormGroup} from "@angular/forms";


@Component({
  selector: 'app-players',
  templateUrl: './player-profiles.component.html',
  styleUrls: ['./player-profiles.component.css']
})
export class PlayerProfilesComponent implements OnInit{

  public searchResultPlayers: PlayerProfileRm[] = [];

  private searchForm: FormGroup | undefined;

  constructor(private route: ActivatedRoute, private playerProfilesService: PlayerProfilesService, private formBuilder: FormBuilder) { }

  ngOnInit(): void {
    this.route.paramMap.subscribe(params => {
      this.playerProfilesService.getAllPlayerProfiles().subscribe(response => {
        this.searchResultPlayers = response;
      })
    })

    const idForm = new FormControl();
    const nameForm = new FormControl();
    const phoneNumberForm = new FormControl();
    const fromDateForm = new FormControl();
    const toDateForm = new FormControl();
    this.searchForm = this.formBuilder.group({
      id: idForm,
      name: new FormControl(),
      email: new FormControl(),
